Legendrecosaphadiff = Legendrecosalpha(1:n)-Legendrecosalpha(3:n+2);

% Precalculate spherical Hankel function derivatives
HDer = zeros(n,length(k));
for N = 0:n
    HDer(N+1,:) = 0.5*sqrt(pi ./(2*k.*a)) .* (besselh(N - 0.5,1,k.*a) - besselh(N + 1.5,1,k.*a));
end

lengththeta = length(theta);
lengthk = length(k);

% calculate pressure
p = zeros(lengththeta,lengthk,length(r));
for Rcount = 1:length(r)
    p(:,:,Rcount) = repmat((1-cosdalpha).*(sqrt(pi./(2*k.*r(Rcount))).*besselh(0.5,1,(k.*r(Rcount)))./HDer(1,:)),[lengththeta,1]); % N=0
    for N = 1:n % N>0
        p(:,:,Rcount) = p(:,:,Rcount) + repmat(Legendrecosaphadiff(N)...
            .*(sqrt(pi./(2*k.*r(Rcount))).*besselh((N+0.5),1,(k.*r(Rcount)))./HDer(N+1,:)),...
            [lengththeta,1])...
            .*repmat(Legendrecostheta(N,:)',[1,lengthk]);
    end
end

% apply coefficient
if (length(W)>1) && (lengthk == length(W))
    p = p .* repmat((1i.*rho.*c.*W(:)')./2,[lengththeta,1,length(r)]);
elseif (length(W)>1) && ~(lengthk == length(W))
    p = p * (1i.*rho.*c.*W(1))./2;
    disp(['W length does not match f length, so first value of W (' num2str(W(1)) ') has been used for all frequencies'])
else
    p = p * (1i.*rho.*c.*W)./2;
end
    
%toc

% some simple plots to check results
if doplot && lengthk>1
    % Create figure
    figure1 = figure;
    
    % Create axes
    axes1 = axes('Parent',figure1);
    hold(axes1,'on');
    
    % Create mesh
    mesh(f,theta,mag2db(abs(p(:,:,1))),'Parent',axes1);
    
    view(axes1,[-117.6 20.9868613138686]);
    grid(axes1,'on');
    % Set the remaining axes properties
    set(axes1,'XMinorTick','on','XScale','log');
    title(['distance ' num2str(r(1))])
    xlabel('Frequency (Hz)')
    ylabel('Theta (deg)')
    zlabel('Lp (dB)')
    
    if length(r)>1
        % Create figure
        figure1 = figure;
        
        % Create axes
        axes1 = axes('Parent',figure1);
        hold(axes1,'on');
        
        findex = find(f==1000,1);
        if isempty(findex), findex = round(lengthk/2); end
        % Create mesh
        mesh(r,theta,mag2db(abs(permute(p(:,findex,:),[1,3,2]))),'Parent',axes1);
        
        view(axes1,[-117.6 20.9868613138686]);
        grid(axes1,'on');
        % Set the remaining axes properties
        set(axes1,'XMinorTick','on','XScale','log');
        title(['frequency ' num2str(f(findex))])
        xlabel('Distance (m)')
        ylabel('Theta (deg)')
        zlabel('Lp (dB)')
    end
end

%pref = a*rho*c*(1i*k*a/(1+i*k*a))*W*exp(-1i*k*(r-a))./r;
%for m = 1:30, LegendreFunctions{m,1} = ['Legendretheta(' num2str(m) ',:)='   legendrep(m,'cosdtheta') ';']; end